import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div>
      <ul>
        <li>
          <Link to="/dashboard/page1">Page 1</Link>
        </li>
        <li>
          <Link to="/article-Cardio-Kickboxing">Page 2</Link>
        </li>
      </ul>
    </div>
  );
};

export default Sidebar;
